/**
 * 企业发展历程
 */
import React, {Component} from 'react';
import {Timeline} from 'antd';
import {ClockCircleOutlined, DollarCircleOutlined} from '@ant-design/icons';

class Course extends Component {
    render() {
        return (
                <Timeline mode="alternate" pending='奇迹正在诞生......'>
                    <Timeline.Item><b>2021.05.01</b> 飞云在成都市高新区注册成立</Timeline.Item>
                    <Timeline.Item><b>2021.10.01</b> 飞云注册企业突破50家，服务企业用户30000+</Timeline.Item>
                    <Timeline.Item dot={<DollarCircleOutlined style={{fontSize: '16px'}}/>}>
                        Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque
                        laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto
                        beatae vitae dicta sunt explicabo.
                    </Timeline.Item>
                    <Timeline.Item color="red">Network problems being solved 2015-09-01</Timeline.Item>
                    <Timeline.Item>Create a services site 2015-09-01</Timeline.Item>
                    <Timeline.Item dot={<ClockCircleOutlined style={{fontSize: '16px'}}/>}>
                        Technical testing 2015-09-01
                    </Timeline.Item>
                </Timeline>
        );
    }
}

export default Course;
